    };

    const NODE_TYPES = {
      python:     ['function_definition'],
      javascript: ['function_declaration','method_definition'],
      go:         ['function_declaration','method_declaration'],
      rust:       ['function_item','impl_item']
    };

    async function loadLanguage(ext) {
      const b64 = WASM_BASE64[ext];
      if (!b64) throw new Error(`Êú™ÈÖçÁΩÆ .${ext} ÁöÑ Base64`);
      const bytes = Uint8Array.from(atob(b64), c => c.charCodeAt(0));
      const blob  = new Blob([bytes], { type: 'application/wasm' });
      const url   = URL.createObjectURL(blob);
      return Parser.Language.load(url);
    }

    function extractFunctions(node, lines, types, baseLine = 1, out = []) {
      if (types.includes(node.type)) {
        let name = '<anon>';
        const nn = node.childForFieldName('name');
        if (nn) {
          const s = nn.startPosition, e = nn.endPosition;
          name = (s.row === e.row)
            ? lines[s.row].slice(s.column, e.column)
            : lines.slice(s.row, e.row+1).join('\n').slice(s.column);
        }
        const st = node.startPosition, en = node.endPosition;
        out.push({
          name,
          start: [st.row + baseLine, st.column + 1],
          end:   [en.row + baseLine, en.column + 1]
        });
      }
      for (let i = 0; i < node.childCount; i++) {
        extractFunctions(node.child(i), lines, types, baseLine, out);
      }
      return out;
    }

    async function parseText(ext, text) {
      if (ext === 'html') {
        const all = [];
        const re = /<script(?:[^>]*type=["']text\/javascript["'])?>([\s\S]*?)<\/script>/gi;
        let m;
        while ((m = re.exec(text)) !== null) {
          const baseLine = text.slice(0, m.index).split('\n').length;
          const Lang = await loadLanguage('js');
          const p = new Parser(); p.setLanguage(Lang);
          const tree = p.parse(m[1]);
          all.push(...extractFunctions(tree.rootNode, m[1].split('\n'),
                                       NODE_TYPES.javascript, baseLine));
        }
        return all;
      }

      const Lang = await loadLanguage(ext);
      const p = new Parser(); p.setLanguage(Lang);
      const tree  = p.parse(text);
      const types = NODE_TYPES[p.getLanguage().name] || [];
      return extractFunctions(tree.rootNode, text.split('\n'), types);
    }

    /* ==== ÁªëÂÆö UI ==== */
    const codeInput  = document.getElementById('code-input');
    const langSelect = document.getElementById('lang-select');
    const analyzeBtn = document.getElementById('analyze-btn');
    const output     = document.getElementById('output');

    analyzeBtn.addEventListener('click', async () => {
      const code = codeInput.value.trim();
      if (!code) {
        output.textContent = '‚ùå ËØ∑ÂÖàËæìÂÖ•‰ª£Á†Å';
        return;
      }
      const ext = langSelect.value;
      output.textContent = 'Ê≠£Âú®ÂàÜÊûêÔºåËØ∑Á®çÂÄô‚Ä¶';
      try {
        const funcs = await parseText(ext, code);
        output.textContent = funcs.length
          ? funcs.map((f,i)=>`${i+1}. ${f.name} Ë°å ${f.start[0]}:${f.start[1]} - ${f.end[0]}:${f.end[1]}`).join('\n')
          : 'Êú™ÂèëÁé∞‰ªª‰ΩïÂáΩÊï∞ÂÆö‰πâ„ÄÇ';
      } catch (err) {
        output.textContent = '‚ùå ' + err.message;
      }
    });
  })();
